sys_variable_value.value:
(function execute(inputs, outputs) {


payload = { "from": inputs.from, 
            "to": inputs.to,
            "value": inputs.value,
            "data": inputs.data,
            "gas": inputs.gas,
            "gasPrice": inputs.gas_price,
            "nonce": inputs.nonce
}

outputs.payload = JSON.stringify(payload);

})(inputs, outputs);

